import React, { Component } from 'react'
import { BrowserRouter, Route, Link,Routes } from 'react-router-dom';
import BmiForm from '../bmi/BmiForm';
import Choices from '../choiceComponent/Choices';
import { Switch } from '@material-ui/core';

export class App extends Component {
  render() {
    return (
      <BrowserRouter>
      <nav>
        <ul><li><Link to={'/'}>choices</Link></li></ul>
      </nav>
      <Routes>
        <Route path="/" element={<Choices />} />
        <Route path="/BMI" element={<BmiForm/>} />
        </Routes>
      </BrowserRouter>
    );
  }
};

export default App;
